import { StyleSheet } from 'react-native';

export default StyleSheet.create({
  preencher: {
    flex: 1,
  },
  espaco: {
    padding: 10
  }
});

export const color = {
  black: '#000000',
  green: '#428a41',
  escuro: '#555555',
  white: '#fff',
  gray: '#C7C7C7',
};
